import styled from "styled-components";

const Main = () => {
  return (
    <Container>
      <h1>
          Hi <br/>
          Hello
      </h1>
    </Container>
  );
};

const Container = styled.div`
    width: 100%;
    height: 100%;
    display: flex;
    justify-content: center;
    align-items: center;

    h1 {
        font-size: 65px;
        font-weight: 900;
        color: #343434;


    }
`;

export default Main;
